import React from 'react';
import PropTypes from 'prop-types';

const SectionStyle = {
  height: '100vh'
}


const Section = (props) => {
  return(
    //<AboutUs />
    <section className="container-fluid m-1 h-100" style={SectionStyle} >
      <div className="row">
        <props.component />
      </div>
    </section>
  );
}

Section.propTypes = {
  component: PropTypes.node.isRequired
}


export default Section;
